(65, 26, '_form', '<div class=\"container\">\n  <div class=\"row\">\n    <div class=\"columns full\">\n      <label>Pilih Jenis Servis :</label> [select* Jenis-Servis include_blank \"Cuci AC\" \"Servis AC Panas\" \"Servis AC Bocor\" \"Servis AC Mati\" \"Instalasi/Relokasi\" \"Lainnya\"]</div>\n  </div>\n  <br>\n  <div class=\"row\">\n    <div class=\"columns full\">\n      <label>Pilih Jenis Properti :</label> [radio Jenis-Properti label_first default:1 \"Rumah\" \"Ruko\" \"Gedung\"]</div>\n  </div>\n  <br>\n  <div class=\"row\">\n    <div class=\"columns one-half\">\n      <label>Tanggal Pengerjaan :</label> [date* Tanggal-Pengerjaan]</div>\n    <div class=\"columns one-half\">\n      <label>Jam Pengerjaan :</label> [number* Jam-Pengerjaan]</div>\n  </div>\n  <br>\n  <div class=\"row\">\n    <div class=\"columns one-half\">\n      <label>Alamat Lengkap :</label>[text* Alamat-Lengkap]</div>\n    <div class=\"columns one-half\">\n      <label>Pilih Daerah :</label> [select* Pilih-Daerah include_blank \"Makassar\" \"Gowa\" \"Palopo\" \"Bone\" \"Parepare\" \"Maros\" \"Bulukumba\" \"Bantaeng\" \"Barru\" \"Toraja\" \"Toraja Utara\" \"Luwu\" \"Luwu Timur\" \"Luwu Utara\" \"Enrekang\" \"Sidrap\" \"Pinrang\" \"Sinjai\" \"Wajo\" \"Soppeng\" \"Pangkep\" \"Takalar\" \"Jeneponto\" \"Selayar\"]</div>\n  </div>\n  <br>\n  <div class=\"row\">\n    <div class=\"columns full\">\n      <label>Deskripsi Keluhan Anda :</label>[text* Keluhan]</div>\n  </div>\n  <br>\n  <div class=\"row\">\n    <div class=\"columns full\">\n      <label>Nama Lengkap :</label>[text* Nama-Lengkap]</div>\n  </div>\n  <br>\n  <div class=\"row\">\n    <div class=\"columns full\">\n      <label>Email :</label>[text* Email]</div>\n  </div>\n  <br>\n  <div class=\"row\">\n    <div class=\"columns full\">\n      <label>Nomor Hp/Wa :</label>[text* Nomor-Handphone]</div>\n  </div>\n  <br>\n  <div class=\"row\">\n    <div class=\"columns one-third offset-four\">\n      [multistep \"1-1\"] [submit \"Submit\"]</div>\n  </div>\n</div>'),
