mbantu proses pemindahan tersebut</p>		\n										<img width=\"750\" height=\"750\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/ac1.jpg\" alt=\"\" srcset=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/ac1.jpg 900w, http://localhost:8888/servisac/wp-content/uploads/2018/12/ac1-150x150.jpg 150w, http://localhost:8888/servisac/wp-content/uploads/2018/12/ac1-300x300.jpg 300w, http://localhost:8888/servisac/wp-content/uploads/2018/12/ac1-768x768.jpg 768w\" sizes=\"(max-width: 750px) 100vw, 750px\" />											\n			<h5>Pasang Baru</h5>		\n		<p>Percayakan pemasangan/konsultasikan AC Anda kepada Kami yang sudah bekerjasama terhadap berbagai produk AC terbaik</p>		\n			<h2>Testimoni</h2>		\n										<img width=\"296\" height=\"171\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/pak.png\" alt=\"\" />											\n			<h5>Novita/Dosen</h5>		\n		<p>“Dapat dipercaya, lebih terbuka dalam penanganan dan tidak ada kerusakan tambahan yang dibuat-buat oleh teknisi”</p>		\n										<img width=\"296\" height=\"171\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/ibu.png\" alt=\"\" />											\n			<h5>Asmar/Kopiapi</h5>		\n		<p>“Tidak perlu repot lagi mencari teknisi ketika AC di kantor bermasalah”</p>		\n										<img width=\"296\" height=\"171\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/pak.png\" alt=\"\" />											\n			<h5>Alif Rahman/Tekno Daeng</h5>		\n		<p>“Pemeriksaan berkala lebih mudah tidak ada lagi kata terlambat perawatan AC”</p>		\n			<h2>Partner</h2>		\n										<img width=\"300\" height=\"300\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06-1-300x300.png\" alt=\"\" srcset=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06-1-300x300.png 300w, http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06-1-150x150.png 150w, http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06